Ikha () is a rural locality (a selo) in Tsuntinsky District, Republic of Dagestan, Russia. Population:  There is 1 street in this selo.
Geography
Selo is located 159&nbsp;km from Makhachkala (capital of Dagestan) and 1,646&nbsp;km from Moscow. Chaatli is the nearest rural locality.
